import React from 'react'
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom'

import EmployeeRegistrationForm from '../myPractice/EmployeeRegistrationForm'
import EmployeeAddPage from '../addPages/EmployeeAddPage'
import Signup from "../home/Signup";

import AdminWorkRouter from "./AdminWorkRouter";
import SalesPage from "../addPages/sales/Sales";
import MaterialAddPage from "../addPages/MaterialAddPage";
import Signin from "../home/Signin";
import HomePage from '../home/HomePage'


const GeneralRouter =()=>{
    return(
        <Router>
            <Switch>
                <Route exact path= "/" component = {HomePage}/>

                <Route exact path = "/signup" component = {Signup}/>
                <Route exact path = "/signin" component = {Signin}/>
                <Route exact path = "/admin" component = {AdminWorkRouter}/>

                <Route exact path = "/employee/add" component = {EmployeeAddPage}/>
                <Route exact path = "/sales/add" component = {SalesPage}/>

                <Route exact path ="/employee/list" component = {EmployeeAddPage}/>

                <Route exact path = "/materials/add" component = {MaterialAddPage}/>


                <Route exact path = "/admin/signin/materials/list" component = {EmployeeRegistrationForm}/>
                <Route exact path = "/admin/signin/customers/list" component = {EmployeeRegistrationForm}/>



            </Switch>
        </Router>
    )
}
export default GeneralRouter
